import { Injectable } from "@angular/core";

// @Injectable
export class UserService{

    var mysql = require('mysql');

    var con = mysql.createConnection({
      host: "localhost",
      user: "root",
      password: "root",
      database: "users"
    });
    
    con.connect(function(err) {
      if (err) throw err;
      con.query("SELECT * FROM usersinfo", function (err, result, fields) {
        if (err) throw err;
        console.log(result);
      });
    });




    
}
